import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Pagina1 from './Component/Pagina1';
import Pagina2 from './Component/Pagina2';

class App extends Component {  
  render() {  
    return (  

    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Página 1</Link>
            </li>
            <li>
              <Link to="/Component/pagina2">Página 2</Link>
            </li>
          </ul>
        </nav>
        <Routes>
        <Route exact path='/' element={< Pagina1 />}></Route>
        <Route exact path='/Component/pagina2' element={< Pagina2 />}></Route> 
        </Routes>
      </div>
    </Router>
   );  
  }  
}  

export default App;
